"use strict";var materialButtons=document.getElementsByClassName("cy-mt-btn");function createRipple(t){var e=document.createElement("div");this.appendChild(e);var i=Math.max(this.clientWidth,this.clientHeight);e.style.width=e.style.height=i+"px";var l=this.getBoundingClientRect();e.style.left=t.clientX-l.left-i/2+"px",e.style.top=t.clientY-l.top-i/2+"px",e.classList.add("ripple")}Array.prototype.forEach.call(materialButtons,t=>{t.classList.contains("disabled")||t.addEventListener("click",createRipple)});
